import React from 'react';

const Like = () => {
    return (
        <div>
            (!this.props.liked) ? <i onClick={this.props.onClick} className="far fa-heart"></i>
            :
            <i onClick={this.props.onClick} className="fas fa-heart"></i>
        </div>
    );
};

export default Like;
